latestCypherQueries.query:
MATCH (a:Internal|External {accountNumber: "9472407307"})-[f:PERFORMS]->(first_tx:Transaction)
MATCH path=(a)-[f]->(first_tx)
      (
        (tx_i:Transaction)-[:BENEFITS_TO]->(a_i:Internal|External)-[:PERFORMS]->(tx_j:Transaction)
        WHERE tx_i.date < tx_j.date
        AND tx_i.amount >= tx_j.amount >= 0.80 * tx_i.amount
      ){2,15}
      (last_tx:Transaction)-[:BENEFITS_TO]->(a)
WHERE COUNT {WITH a, a_i UNWIND [a] + a_i AS b RETURN DISTINCT b} = size([a] + a_i)
WITH collect(path) AS paths, a

// 1. Flatten paths into unique sets of Real Nodes and Relationships
WITH a,
     apoc.coll.toSet(apoc.coll.flatten([p IN paths | nodes(p)])) AS realNodes,
     apoc.coll.toSet(apoc.coll.flatten([p IN paths | relationships(p)])) AS realRels

// 2. Create a Map: Real Node ID -> Virtual Node
WITH a, realRels,
     apoc.map.fromPairs([n IN realNodes |
       [toString(id(n)),
        apoc.create.vNode(
           // Condition: Add 'startAccount' label only to the start node 'a'
           CASE WHEN n.accountNumber = a.accountNumber
                THEN labels(n) + 'startAccount'
                ELSE labels(n) END,
           properties(n)
        )
       ]
     ]) AS vNodeMap

// 3. Create Lists of Virtual Nodes and Relationships
// FIX: We use list comprehension to extract values from the map
WITH [key IN keys(vNodeMap) | vNodeMap[key]] AS vNodes,
     [r IN realRels |
       apoc.create.vRelationship(
         vNodeMap[toString(id(startNode(r)))],
         type(r),
         properties(r),
         vNodeMap[toString(id(endNode(r)))]
       )
     ] AS vRels

// 4. Create the final graph object
CALL apoc.graph.fromData(vNodes, vRels, 'test', {}) YIELD graph AS g
RETURN g
